import { GET_MONTHLY_EVENTS } from "../actions/types";

export default function setCalendar(state = initialState, action) {
  switch (action.type) {
    case GET_MONTHLY_EVENTS:
      return {
        ...state,
        monthly: action.payload,
      };
    default:
      return state;
  }
}
